import React,{createContext, useState , useContext} from 'react';

const MoreInfoContext = createContext({});


export const  MoreInfoProvider= ({children}) => {
    const [moreInfo, setMoreInfo ] = useState(false);
    const [ moreInfoId, setMoreInfoId ] = useState();

    return(
    <MoreInfoContext.Provider value={{moreInfo, setMoreInfo, moreInfoId, setMoreInfoId}}>
     {children}
    </MoreInfoContext.Provider>
    )
}


export const useMoreInfo = () => useContext(MoreInfoContext);
